import React from 'react';
// import stylings
import './App.css';
// import components
import Header from './components/Header';
import Social from './components/Social';
// import data
import Data from './JSONs/Master.json';

function App() {
  return (
    <div className="App">
      <Header 
        title={Data.Name}
        subtitle={Data.Graduation}
      />
      <Social 
        social={Data.Social}
      />
    </div>
  );
}

export default App;
